import returnSearch from "./returnSearch"

export default function getSearch(string, ret=['Device', 'User', 'Did']) {
  let temp = {}
  ret.forEach(e => temp[e.toLowerCase()] = returnSearch(eval(`get${e}Data`), string.target.value.toLowerCase(), eval(`filteredSearch.${e.toLowerCase()}.results`)))
  return temp
}
